import React, { Component } from 'react'

export default class index extends Component {
  add = () => {
    console.log(this.uname.value);
    console.log(this.uage.value);
  }
  render() {
    return (
      <div>
        <h2>Person</h2>
        <input type="text" placeholder="name" ref={c => this.uname = c} />
        <input type="text" placeholder="age" ref={c => this.uage = c} />
        <button onClick={this.add}>add</button>
      </div>
    )
  }
}
